title:
ПОСЛУГИ ЛІКУВАЛЬНИХ ЗАКЛАДІВ – (ПОСЛУГИ ЛІКУВАЛЬНИХ ЗАКЛАДІВ КОД ДК 021:2015 – 85111000-0) - ПОСЛУГИ ІЗ САНАТОРНО-КУРОРТНОГО ЛІКУВАННЯ ДЛЯ ВЕТЕРАНІВ ПРАЦІ, ДІТЕЙ ВІЙНИ, УЧАСНИКІВ БОЙОВИХ ДІЙ, УЧАНИКІВ ВІЙНИ, ІНВАЛІДІВ, ІНВАЛІДІВ З ДИТИНСТВА, УЧАСНИКІВ БОЙОВИХ ДІЙ В АТО ТА ПУТІВКИ БЕЗ ЛІКУВАННЯ ДЛЯ СУПРОВОДЖУЮЧИХ ІНВАЛІДІВ І ГРУПИ (5 ЛОТІВ):
-	ЛОТ №1 – ПУТІВКИ ЗАХВОРЮВАННЯ ОПОРНО-РУХОВОГО АПАРАТУ (КІРОВОГРАДСЬКА ОБЛ.);
-	ЛОТ №2 – ПУТІВКИ ЗАХВОРЮВАННЯ ОРГАНІВ ДИХАННЯ (КІРОВОГРАДСЬКА ОБЛ.);
-	ЛОТ №3 – ПУТІВКИ ЗАХВОРЮВАННЯ НЕВРОЛОГІЧНОГО ПРОФІЛЮ (КІРОВОГРАДСЬКА ОБЛ).
-	ЛОТ №4 – КУРСІВКИ ЗАХВОРЮВАННЯ ОПОРНО-РУХОВОГО АПАРАТУ (КІРОВОГРАДСЬКА ОБЛ.);
-	ЛОТ №5 – КУРСІВКИ ЗАХВОРЮВАННЯ НЕВРОЛОГІЧНОГО ПРОФІЛЮ (КІРОВОГРАДСЬКА ОБЛ.)

Організація харчування учнів загальноосвітніх шкіл,
Лот 1 – організація харчування учнів ЗОШ І-ІІ ст.. №27, Троїцької ЗОШ І-ІІІ ст..;
Лот 2 – організація харчування учнів Врубівської ЗОШ І-ІІІ ст., Новоіванівської ЗОШ І-ІІ ст.;
Лот 3 – організація харчування учнів Золотарівської ЗОШ І-ІІ ст..;  ЗОШ І-ІІІ ст.. с.Лисичанське

1. Халат медичний (хірургічний) на зав`язках довжиною 130 см (розмір 50-52 (L)) стерильний,  (СМС – не менше 35 г/м2 ), шт. 1000;
2. Фартух медичний довжиною 110 см стерильний, (ламінований спанбонд – не менше 45 г/м2 ), шт. 200;
3. Фартух медичний довжиною 140 см стерильний, (ламінований спанбонд – не менше 45 г/м2 ), шт. 500.
